Today Rock Squad YouTuber Faye and Nico from Menudo survive three of the absolute worst babysitters ever in this popular YouTube trend. Their role play parents Ryder and Gia think they have finally found the right sitter so they can at last have a date night without the kids bothering them but nothing goes as planned and the teens they have hired to watch their sneaky kids get progressively worse! When Faye and nico implement their master plan to get the new babysitter fired, things quickly take a turn for the worse when babysitter number 2 and number 3 are even worse than the first one! 
Comment who you think they should keep or should Ryder and Gia interview 20 more babysitters for Faye to find the perfect match? Thanks for watching our live action viral sketch YouTube comedy in 2024. 
